When I open my 562 loading 602 the cache downloads but when it gets to extracting it doesn't do anything, Could someone help me out?

Here is the unzipping void,
<blockquote>public static void unZipFile(String location, String fileName) {
		try {
			ZipFile zipfile = new ZipFile(location + fileName);
			Enumeration<?> enumeration = zipfile.entries();
			while (enumeration.hasMoreElements()) {
				ZipEntry zipentry = (ZipEntry) enumeration.nextElement();
				if (zipentry.isDirectory())
					new File(location + zipentry.getName()).mkdir();
				else
					writeORead(zipfile.getInputStream(zipentry),
							(new BufferedOutputStream(
									new FileOutputStream(location))));
			}
			zipfile.close();
		} catch (Exception exception) {
			if(Constants.DEBUG_MODE) {
				exception.printStackTrace();
				pf.a(exception, "Error unziping cache.");
			}
		}
	}</blockquote>
